import './home.css'
import React from 'react'
import { useEffect } from 'react'


export default function Home() {

  useEffect(()=>{
    fetch('https://api.themoviedb.org/3/trending/movie/week?api_key=89fd381db9ad27b0433e7f45be441eda')
    .then(res=>res.json()
    .then(data=>console.log(data.results)))
  })


  return (
    <div>
      <div className='most_popular'>
        <h3></h3>
      </div>
    </div>
  )
}
